import React, { Component } from 'react';
import asheville from './Liza-Asheville.jpg';
import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import Contact from "./Contact";
import About from "./About";

class Home extends Component {
  render () {
    return (
      <div>
        <img src={asheville} className="asheville-photo" alt="asheville" />
        <HashRouter>
          <div className="nav-text">
            <p><NavLink to="/home">Home</NavLink></p>
            <p><NavLink to="/gallery">Gallery</NavLink></p>
            <p><NavLink to="/contact">Contact</NavLink></p>
            <p><NavLink to="/about">About</NavLink></p>
          </div>
          <div>
            <Route path="/" component={Home}/>
            <Route path="/gallery" component={Gallery}/>
            <Route path="/contact" component={Contact}/>
            <Route path="/about" component={About}/>
          </div>
        </HashRouter>
        <div className="title">
          Liza Morrison Art
        </div>
      </div>
    );
  }
}

export default Home;
